import React, { useState, useEffect } from 'react';
import { StringToColor, AvatarIcon } from './index';

import axios from 'axios';

import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import DialogTitle from '@mui/material/DialogTitle';
import Dialog from '@mui/material/Dialog';
import AddIcon from '@mui/icons-material/Add';
import Typography from '@mui/material/Typography';
import { blue } from '@mui/material/colors';
import { AccountBalance } from '@mui/icons-material';



const Home = (props: Props) => {

   const [accounts, setAccounts] = useState<User[]>([]);
   const [newAccountName, setNewAccountName] = useState("");

   useEffect(() => {
      axios.get('http://localhost:8080/account')
      .then(res => {
         setAccounts(res.data)
      })
   }, [accounts]);

   function accountHandle(user: User, setUser: React.Dispatch<React.SetStateAction<User>>) {
      return (
         <button onClick={()=>setUser(user)}>
            {user.name}でログイン
         </button>
      );
   };

   function addAccountHandle() {

      function submitHandle(event: React.FormEvent<HTMLFormElement>) {
         if (newAccountName !== "") {
            const newAccountColor = StringToColor(newAccountName)
            const data = {
              Name:    newAccountName, 
              Color:   newAccountColor
            };
            axios.post('http://localhost:8080/account', data)
            setNewAccountName("")
         } else {
            event.preventDefault()
         };
      };

      return(
         <form onSubmit={submitHandle}>
            <div>
               <input 
                  className="accountEnter"
                  value={newAccountName}
                  placeholder="アカウントを追加"
                  onChange={(event)=>{setNewAccountName(event.target.value)}}
               />
            </div>
            <div>
               <input
                  className="post"
                  type="submit"
                  value="追加"
               /> 
            </div>
         </form>
      );
   };

   return (
      <div className="homeContents">
         <div className="title">
            <h1>Snack</h1>
         </div> 
         <h3>ユーザーを選んでください</h3>
         <div className="accounts">
            {accounts.map((account: User, index:number)=>(
               <li key={index}>
                  {accountHandle(account, props.setUser)}
               </li>
            ))}
            <br />
         </div>
            <div>
               {addAccountHandle()}
            </div>
        </div>
   );
};



const emails = ['username@gmail.com', 'user02@gmail.com'];

export interface SimpleDialogProps {
  open: boolean;
  selectedValue: string;
  onClose: (value: string) => void;
}

function SimpleDialog(props: SimpleDialogProps) {
  const { onClose, selectedValue, open } = props;

  const handleClose = () => {
    onClose(selectedValue);
  };

  const handleListItemClick = (value: string) => {
    onClose(value);
  };

  return (
    <Dialog onClose={handleClose} open={open}>
      <DialogTitle>アカウントを選択してください</DialogTitle>
      <List sx={{ pt: 0 }}>
        {accounts.map((email) => (
          <ListItem button onClick={() => handleListItemClick(email)} key={email}>
            <AvatarIcon accountName={account.name} accountColor={account.color} /> 
            <ListItemText primary={email} />
          </ListItem>
        ))}
        <ListItem autoFocus button onClick={() => handleListItemClick('addAccount')}>
          <ListItemAvatar>
            <Avatar>
              <AddIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText primary="アカウントを追加" />
        </ListItem>
      </List>
    </Dialog>
  );
}

type User = {
   name: string
   id: string 
   color: string
};

type Props = {
   setUser: React.Dispatch<React.SetStateAction<User>>
};

const UserSelect = (props: Props) => {
  const [open, setOpen] = React.useState(false);
  const [selectedValue, setSelectedValue] = React.useState(emails[1]);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = (value: string) => {
    setOpen(false);
    setSelectedValue(value);
  };

  return (
    <div>
      <Typography variant="subtitle1" component="div">
        Selected: {selectedValue}
      </Typography>
      <br />
      <Button variant="outlined" onClick={handleClickOpen}>
        Open simple dialog
      </Button>
      <SimpleDialog
        selectedValue={selectedValue}
        open={open}
        onClose={handleClose}
      />
    </div>
  );
};

export default UserSelect;
